import React from 'react';
import {Footer, FooterTab, Button, Text} from 'native-base';

const AppFooter = () => {
    <Footer>
        <FooterTab>
            <Button active>
                Статьи
            </Button>
            <Button>
                <Text>Подкасты</Text>
            </Button>
        </FooterTab>
    </Footer>
};

export default AppFooter;
